import React from 'react'
import  './chart.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


export default function Chart() {
    const data = [
        {
          month: 'Jen',
          "Active Revenue": 4000,
          pv: 2400,
          amt: 2400,
        },
        {
          month: 'Feb ',
          "Active Revenue": 3000,
          pv: 1398,
          amt: 2210,
        },
        {
          month: 'Mar',
          "Active Revenue": 2000,
          pv: 9800,
          amt: 2290,
        },
        {
          month: 'Apr',
          "Active Revenue": 2780,
          pv: 3908,
          amt: 2000,
        },
        {
          month: 'May',
          "Active Revenue": 1890,
          pv: 4800,
          amt: 2181,
        },
        {
          month: 'Jun',
          "Active Revenue": 2390,
          pv: 3800,
          amt: 2500,
        },
        {
          month: 'Jul',
         "Active Revenue" : 3490,
          pv: 4300,
          amt: 2100,
        },
        {
            month: 'Jul',
           "Active Revenue" : 1490,
            pv: 4300,
            amt: 2100,
          },
          {
            month: 'Aug',
           "Active Revenue" : 4910,
            pv: 4300,
            amt: 2100,
          },
          {
            month: 'Oct',
           "Active Revenue" : 2490,
            pv: 4300,
            amt: 2100,
          },
          {
            month: 'Nov',
           "Active Revenue" : 5210,
            pv: 4300,
            amt: 2100,
          },
          {
            month: 'Dec',
           "Active Revenue" : 3130,
            pv: 4300,
            amt: 2100,
          },
      ];
    return (
        <div className="chart">
             <h3 className='chartTitle'>Revenue Analysis</h3>
             <ResponsiveContainer width='100%' aspect={4/1}>
                 <LineChart data={data}>
                     <XAxis dataKey="month" stroke="#0a1931"/>
                     <YAxis dataKey="amount" stroke="#0a1931"/>

                     <Line type="monotone" dataKey="Active Revenue" stroke="#0a1931"/>
                     <Tooltip/>
                 </LineChart>

             </ResponsiveContainer>
        </div>
    )
}
